import React from 'react'
import AcquisitionCard from './AcquisitionCard'

function AcquisitionsList({ 
    users,
    currentUser, 
    onAcquireArtwork,
}){
    console.log(users)
    const userCard =
        users.map((user) => {
            return (
                // <AcquisitionCard
                <div>
                    key={user.id}
                    user={user}
                    userAcquisition={
                        user.acquisitions.map((acquisition) => 
                            acquisition={acquisition}
                        )}
                    currentUser={currentUser} 
                    onAcquireArtwork={onAcquireArtwork}
                </div>
                // />
            )
    })

    return(
        <div>
             <h4>The Collections</h4>
             {userCard}
            {/* {userAcquisitions} */}
        </div>
    );
}

